  #   - tls://dns.rubyfish.cn:853 # dns over tls
  #   - https://1.1.1.1/dns-query # dns over https
  # fallback: # concurrent request with nameserver, fallback used when GEOIP country isn't CN
  #   - tcp://1.1.1.1
  # fallback-filter:
  #   geoip: true # default
  #   ipcidr: # ips in these subnets will be considered polluted
  #     - 240.0.0.0/4

proxies:
# 支持的协议及加密算法示例请查阅 Clash 项目 README 以使用最新格式：https://github.com/Dreamacro/clash/blob/master/README.md

# Shadowsocks 支持的加密方式:
#   aes-128-gcm aes-192-gcm aes-256-gcm
#   aes-128-cfb aes-192-cfb aes-256-cfb
#   aes-128-ctr aes-192-ctr aes-256-ctr
#   rc4-md5 chacha20-ietf xchacha20
#   chacha20-ietf-poly1305 xchacha20-ietf-poly1305

# Shadowsocks
- name: "jms-ss1"
  type: ss
  server: c70s1.jamjams.net
  port: 60337
  cipher: aes-256-gcm
  password: "eyQmzkTZqwRYds24"

# VMess
- name: "jms-ss2"
  type: vmess
  server: c70s801.jamjams.net
  port: 60337
  uuid: 350d410e-ddfc-4b3e-8e49-1476573d9352

  alterId: 8
  cipher: auto
  tls: false

# VMess
- name: "jms-ss3"
  type: vmess
  server: c70s3.jamjams.net
  port: 60337
  uuid: 350d410e-ddfc-4b3e-8e49-1476573d9352
  alterId: 8
  cipher: auto
  tls: false


# 代理组策略
# 策略组示例请查阅 Clash 项目 README 以使用最新格式：https://github.com/Dreamacro/clash/blob/master/README.md

proxy-groups:

# url-test 通过指定的 URL 测试并选择延迟最低的节点
- name: "自动选择快速节点"
  type: url-test
  proxies:
    - "jms-ss1"
    - "jms-ss2"
    - "jms-ss3"
  url: 'http://www.gstatic.com/generate_204'
  interval: 300

# fallback 通过指定的 URL 测试并选择可用的节点，当 1 故障不可用时自动切换到 2 以此类推
# - name: "Fallback"
#   type: fallback
#   proxies:
#     - "1"
#     - "2"
#     - "3"
#     - "4"
#   url: 'http://www.gstatic.com/generate_204'
#   interval: 300

# load-balance: 负载均衡
# - name: "LoadBalance"
#   type: load-balance
#   proxies:
#     - "1"
#     - "2"
#     - "3"
#     - "4"
#   url: 'http://www.gstatic.com/generate_204'
#   interval: 300

# 代理节点选择
- name: "PROXY"
  type: select
  proxies:
    - "jms-ss2"
    - "jms-ss3"
    - "jms-ss1"


# MCCA
- name: "FallbackProxy"
  type: fallback
  proxies:
    - "jms-ss2"
    - "jms-ss3"
    - "jms-ss1"
  url: 'http://www.gstatic.com/generate_204'
  interval: 300

